import { Row } from "react-bootstrap";
import Radar from "./Radar";

import style from "../css/HitterDetailModal.module.css";

const HitterDetailModal = (props) => {
  const data = [
    {
      taste: "fruity",
      chardonay: 30,
      carmenere: 35,
      syrah: 102,
    },
    {
      taste: "bitter",
      chardonay: 41,
      carmenere: 86,
      syrah: 40,
    },
    {
      taste: "heavy",
      chardonay: 20,
      carmenere: 102,
      syrah: 59,
    },
    {
      taste: "strong",
      chardonay: 114,
      carmenere: 33,
      syrah: 61,
    },
    {
      taste: "sunny",
      chardonay: 82,
      carmenere: 39,
      syrah: 43,
    },
  ];
  return (
    <>
      <Row className={style["modal"]}>
        <Row className={style["head"]}>{props.hitter.name}</Row>
        <Row className={style["body"]}>
          <Radar data={data} />
        </Row>
      </Row>
    </>
  );
};

export default HitterDetailModal;
